import React, { Component } from "react";
import Grid from 'styled-components-grid'
import {Footer} from './GridBlocks'



export default class FooterBlock extends Component{
	render(){
		return (
			<Footer>
			<Grid.Unit size={1 / 6}>Awesome!</Grid.Unit>
			</Footer>
		)
	}
}
